import logo from '../../static/KPMG_logo_white.svg';
import PublishRoundedIcon from '@material-ui/icons/PublishRounded';

import React from 'react';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import CloudUploadIcon from '@material-ui/icons/CloudUpload';

const useStyles = makeStyles((theme) => ({
    button: {
        margin: theme.spacing(1),
    },
    input: {
        display: 'none',
    },
}));

export default function UploadBar() {
    const classes = useStyles();

    return (
        <div className='uploadbar_container'>
            <img src={logo} alt='kpmg_logo' style={{ width: '80px', float: 'left' }} />
            <input
                accept="*"
                className={classes.input}
                id="upload-btn"
                multiple
                type="file"
            />
            <label htmlFor="upload-btn"><Button color="action" component="span" startIcon={<CloudUploadIcon />}>Upload</Button></label>

        </div>
    );
};
